import React from "react";

const AuthButtons: React.FC = () => (
  <div style={{ position: "absolute", top: 24, right: 32 }}>
    <button style={{ marginRight: 12 }}>Login</button>
    <button>Sign Up</button>
  </div>
);

export default AuthButtons;
